import { StyleSheet } from "react-native";

export const Styles = StyleSheet.create({
    container: {
        flex: 1,
        margin: 20,
        alignItems: 'center',
        justifyContent: 'center',
        backgroundColor: 'E7DCF2'
    },
    pageTitle: {
        fontSize: 18,
        color: '#734D8C'
    },
});
